import React from 'react';
import classes from "./itemCart.module.css"
import {useDispatch, useSelector} from "react-redux";

const ItemCart = () => {
    const dispath=useDispatch();
    const cart=useSelector(state => state.inCart.products)
    console.log(cart)

    return (
        <div className={classes.cart_item}>
            <div className={classes.img_text_container}>
                <img
                    width="80px"
                    alt=""
                    className="img_item"
                />
                <div className={classes.description}>
                </div>
            </div>
            <div>
                <span className={classes.price}></span>
                <div className="clear_btn"
                ><img
                    src="/source/icons/icons_menu/Trash_light.svg"
                    alt=""
                    className="clear_icon"
                />
                </div>
            </div>
        </div>
    );
};

export default ItemCart;
